import React from "react";
import { Accordion, AccordionItem, AccordionItemHeading, AccordionItemPanel } from "react-accessible-accordion";
const Forecast = ({data}) => {
    console.log(data.list.slice(0,5))
    return (
        <>
            <label htmlFor="" className="title">Daily</label>
            <Accordion allowZeroExpanded>
                {data.list.slice(0,5).map((item, index)=>{
                <AccordionItem key={index}>
                    <AccordionItemHeading></AccordionItemHeading> />
                    <AccordionItemPanel />
                </AccordionItem>

                })}
                
            </Accordion>
        
        </>
    );
}
export default Forecast;
